import logo from './logo.svg';
import './App.css';
import Navbar from './Components/Navbar';
import Homepage from './Pages/Homepage';
import {BrowserRouter , Route , Routes} from 'react-router-dom'


function App() {
  return (
    <BrowserRouter>
      <Navbar/>

      <Routes>
        <Route path='/' element={Homepage}/>



      </Routes>








    </BrowserRouter>

  );
}

export default App;
